import "./App.css";
import { Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <nav className="menu">
        <Link to="/"> Home </Link>
        <Link to="/chat"> Chat </Link>
        <Link to="/discover"> Discover </Link>
        <Link to="/my-status"> My Status </Link>
      </nav>
    </div>

    // </Router>
  );
}

export default App;
